&gt;\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n        &lt;h2&gt; Duration: 15.97 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 205 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 10.17 s &lt;/li&gt;\n&lt;li&gt; transfer time: 125.90 ms &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://172.21.3.55:8786 &lt;/li&gt;\n          &lt;li&gt; Workers: 2 &lt;/li&gt;\n          &lt;li&gt; Threads: 48 &lt;/li&gt;\n          &lt;li&gt; Memory: 345.47 GiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nfrom dask_interface import Deisa\nfrom dask.distributed import performance_report, wait \nimport dask.array as da\nimport os\nimport time \n\n# Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\n# Initialize the Deisa \nDeisa = Deisa(scheduler_info, config_file)\n\n# Get client\nclient = Deisa.get_client()\n\n# Get data descriptor as a list of Deisa arrays object\narrays = Deisa.get_deisa_arrays()\n#or\n# Get data descriptor as a dict of Dask array\n#arrays = Deisa.get_dask_arrays()\n\n# Select data\ngt = arrays[\"global_t\"][...]\nprint(gt, flush=True)\n\n# Check contract\narrays.check_contract()\n\n# Sign contract\n#arrays.validate_contract()\n\ndef Derivee(F, dx):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n       Output: dFdx = first derivative of F\n    \"\"\"\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3: - 1] - F[1: - 3] - (F[4:] - F[:- 4]) / 8.)\n    return dFdx\n\n# py-bokeh is needed if you wanna see the perf report \nwith performance_report(filename=\"dask-report.html\"):\n    t = time.time()\n    # Construct a lazy task graph \n    \n    der = Derivee(gt, 1)\n    cpt =  da.linalg.norm(der, axis=(1,2))\n\n    #arrays.validate_contract()    \n    # Submit the task graph to the scheduler\n    s = client.persist(cpt, release=True)\n    arrays.validate_contract()   \n    \n    # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it. \n    print(client.compute(s).result(), flush=True)    \n\n\n    \n# wait until computation is done\n#k = wait(s)\nprint(\"Done in \",time.time() -t,  flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"coordinates":null,"formatter":{"id":"1451"},"group":null,"major_label_orientation":-0.3490658503988659,"major_label_policy":{"id":"1452"},"ticker":{"id":"1164"}},"id":"1163","type":"CategoricalAxis"},{"attributes":{},"id":"1423","type":"AllLabels"},{"attributes":{},"id":"1127","type":"BasicTicker"},{"attributes":{"line_color":"#1f77b4","x":{"field":"time"},"y":{"field":"memory"}},"id":"1275","type":"Line"},{"attributes":{"child":{"id":"1039"},"title":"Scheduler Profile (administrative)"},"id":"1405","type":"Panel"},{"attributes":{"coordinates":null,"formatter":{"id":"1473"},"group":null,"major_label_policy":{"id":"1474"},"ticker":{"id":"1127"}},"id":"1126","type":"LinearAxis"},{"attributes":{},"id":"1319","type":"AllLabels"},{"attributes":{"coordinates":null,"data_source":{"id":"1110"},"glyph":{"id":"1132"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1134"},"nonselection_glyph":null,"view":{"id":"1136"}},"id":"1135","type":"GlyphRenderer"},{"attributes":{"fill_alpha":{"field":"alpha"},"fill_color":{"field":"color"},"height":{"value":0.4},"line_alpha":{"value":0.6},"line_color":{"field":"color"},"line_width":{"value":3},"width":{"field":"duration"},"x":{"field":"start"},"y":{"field":"y"}},"id":"1132","type":"Rect"},{"att
